data.introspection_response:
schema {
  query: Query
  mutation: Mutation
}
type Listing {
  id: ID!
  title: String!
  image: String!
  address: String!
  price: Int!
  numOfGuests: Int!
  numOfBeds: Int!
  numOfBaths: Int!
  rating: Int!
}
type Query {
  listings: [Listing!]!
}
type Mutation {
  deleteListing(id: ID!): Listing!
}
"Exposes a URL that specifies the behavior of this scalar."
directive @specifiedBy(
    "The URL that specifies the behavior of this scalar."
    url: String!
  ) on SCALAR
